import React from 'react';
import { StyleSheet} from 'react-native';
import { Layout } from '@ui-kitten/components';
import { Notification } from './notifications.component'
const data = new Array(2).fill({
    title: 'Thông báo chung',
    subTitle: 'Chưa có thông báo',
  });

export function NotificationsLayout(){

    return(
      <Layout style={styles.container}>
        <Notification title='Thông báo chung' style={styles.notification} sub_title='Chưa có thông báo nào'/>
        <Notification title='Thông báo bài đăng' style={styles.notification} sub_title='Chưa có thông báo nào'/>
      </Layout>
    );
}
const styles = StyleSheet.create({
  container: {
    flex: 1,
  },
  notification: {
    padding: 20,
    flexWrap:'nowrap'
  },

  section: {
    paddingTop: 32,
  },
});
